import React, { useState, useEffect } from "react";

import { LOAD_BLOGES } from "../GraphQL/Queries";
import { useQuery,useMutation } from "@apollo/client";
import { DELETE_BLOG_MUTATION } from "../GraphQL/Mutations";
import{useNavigate,useLocation} from "react-router-dom"

import Blog from "../images/Blog.jpg"


function GetBloges() {
  const { data, refetch } = useQuery(LOAD_BLOGES);
  const [bloges, setBloges] = useState([]);
  const [deleteBlog, { data: successResponse,  error }] = useMutation(DELETE_BLOG_MUTATION);

  const navigate = useNavigate();
  const location=useLocation()

if(location?.state?.refetch){
  refetch();
}

  const toCreate=()=>{
    navigate("/form",{state:{heading:" ",content:" " ,update:false}})
  }
  const toUpdate=(val)=>{
    console.log(val)
    navigate("/form",{state:{heading:val.heading,content:val.content,id:val.id,update:true}})
  }

  const deleteBlogAction = (id) => {
    deleteBlog({
      variables: {
        id: id,
      },
    });

  };
  useEffect(() => {
    if (successResponse?.deleteBlog?.id) {
      refetch();
      console.log('Blog is deleted successfully!!!');
    } else if (error) {
      console.log('Error: ' + error);
    }
  }, [successResponse, error, refetch]);

  useEffect(() => {
    if (data) {
      setBloges(data.getAllBloges);
    }
  }, [data]);

  return (
    <div>

     <div  id="header">
      <header> 

       <h1 > BLOG APP </h1> 
      </header>
     </div>

     <div id="carouselExampleControls" class="carousel slide" data-ride="carousel">
  <div class="carousel-inner">
  {/* <div class="carousel-item active">
      <img src={Blog} class="d-block w-100" height="350px"/>
    </div> */}
   <div id="carouselExampleControls" class="carousel slide" data-bs-ride="carousel">
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img src={Blog} class="d-block w-100" alt="..."/>
    </div>
    <div class="carousel-item">
      <img src="..." class="d-block w-100" alt="..."/>
    </div>
    <div class="carousel-item">
      <img src="..." class="d-block w-100" alt="..."/>
    </div>
  </div>
  <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Previous</span>
  </button>
  <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Next</span>
  </button>
</div>
  </div>
</div>






      <div className="list-collection">
        {bloges.map((val) => {
          return (
            <div key={val.id} className="list-items">
              <div >
                <br/>
                <h4> {val.heading}</h4>
                <h4> {val.date}</h4>
                <h4> {val.content}</h4>
                <button onClick={()=>toUpdate(val)} className="btn btn-warning" > update</button> 
                {" "}
              <button className="btn btn-info" onClick={() => deleteBlogAction(val.id)}> Delete</button>
                <br/>
              </div>
            </div>
          );
        })}
      </div>
      <br/> 
      <div className="gap-2 d-md-flex justify-content-md-end"  >
          <button   className="btn btn-success me-md-2" onClick={toCreate}>CREATE BLOG</button>
          </div>

    </div>
  );
}

export default GetBloges;
